  BrowserRouter as Router,
} from "react-router-dom";

function App() {

  return (

    <div style={{backgroundImage: "url('https://image.jimcdn.com/app/cms/image/transf/none/path/s03fb617b319ccf37/backgroundarea/i43d30a346a0e75d0/version/1603433921/image.jpg%22')", backgroundSize: 'cover'}}className="App">
      <Router >
      <NavigationBar />
      </Router>


    </div>
  );
}

export default App;
